import "./App.css";
import { Route, Routes } from "react-router-dom";
import Login from "./pages/login/login";
import Disp from "./pages/login/disp";
import React from "react";

function App() {
  return (
    <Routes>
      <Route exact path="/login" element={<Login />} />
      <Route exact path="/Disp" element={() => <Disp authorised={true} />} />
    </Routes>
  );
}

export default App;
